description:
First Release COTA001 @ Cota 303 by Tobetozero (2b20) and Csum - album called &quot;New Folder&quot;
cota303.net/release/new-folder/1

While listening to New Folder, you will find yourself musing upon the ever-changing beauty of our world which is manifested through the art of sound illustration. Soft beats, futuristic samples from the good old times and quirky glitches have been combined to create a wonderfully dynamic journey of melodies.

COTA303 - this is our little online &quot;hive&quot;, limited in 303 &quot;cells&quot; designed to hold the best electronic music selected by our &quot;bees&quot; around the world.
We carefully listen to, analyze and process the music, trying to bring every slightest detail of Your &quot;cells&quot; to perfection.
All the honey of our &quot;cells&quot; are free to listen anywhere, but it originates exclusively in our &quot;hive&quot;
